<ul>
<li>男生：今天下雨了，你带伞了吗？</li>
<li>女生：嗯，带了</li>
<li>男生：那你走路多小心点啊，下雨路滑</li>
<li>女生：嗯</li>
</ul>
<blockquote>
<p>男生不知道咋回了，就准备回女生“嗯呢”。
